message:
Majô, olha as novas regras de um grupo do Telegram:
☕️ CHAT ABERTO!

Para nossa segurança, sigam as novas regras (chatas, eu sei!) e estratégias de comunicação a seguir:

Não postem dados pessoais de ninguém;
Não postem links, fotos ou vídeos;
Não critiquem as urnas eletrônicas;
Não associem deputados e senadores à corrupção;
Não incitem nenhum ato de vandalismo ou violência;
Não escrevam nada sobre manifestações ou paralizações;
Não ofendam outros membros;
Não ataquem o STF nem o TSE;
E NÃO insistam em quebrar essas regras pois são TODAS para garantir nossa segurança e comunicação por aqui. 

A quebra de qualquer uma das regras acima implicará em BANIMENTO imediato do grupo. 

Grato pela compreensão,
Em breve voltamos com mais atualizações! 🙏🇧🇷

A 'Organização das Sombras' apoiada por Soros dá um grande golpe em DeSantis, e eles não têm medo de se sujar

